export interface OAuth2AuthenticationPlan {
    type: "oauth2";
    /** This is the OAuth2 URL. */
    url: string;
    /** This is the OAuth2 client ID. */
    clientId: string;
    /** This is the OAuth2 client secret. */
    clientSecret: string;
    /** This is the scope of the OAuth2 token. */
    scope?: string;
}
